func TestBaseStatistics(t *testing.T) {
	tsds := []TimeSeriesDataS{
		{
			Time:  "2022-06-28 23:00:00",
			Value: 64034.69921875,
		},
		{
			Time:  "2022-06-28 23:02:44",
			Value: 64037,
		},
		{
			Time:  "2022-06-28 23:05:03",
			Value: 64039.5,
		},
		{
			Time:  "2022-06-29 22:45:17",
			Value: 64513.1015625,
		},
		{
			Time:  "2022-06-29 22:51:21",
			Value: 64513.1015625,
		},
		{
			Time:  "2022-06-29 22:56:26",
			Value: 64513.1015625,
		},
		{
			Time:  "2022-06-29 23:00:00",
			Value: 64513.1015625,
		},
	}
	tsdt, _ := Tsds2Tsdt(tsds)

	tests := []struct {
		tsds    []TimeSeriesData
		advance int
		group   int
	}{
		{tsdt, 2, 0},
	}
	for _, tt := range tests {
		var data Tsds
		data = tt.tsds
		res := data.Statistics(tt.advance, tt.group)
		StructFormatPrint(res)
	}
}

